typedef struct Request{
	int clientNum;
	int video;
	int seg;
	int ver;
	int startTime;
	int endTime;
	int seek;
	Request *next;
	Request *prev;
	Request():clientNum(-1){}
	Request(int c, int vd, int s, int v, int st, int et) : clientNum(c), video(vd), seg(s), ver(v), startTime(st), endTime(et), seek(1), next(NULL), prev(NULL){}
}Request;

class List{
	private:
	Request *head, *tail;
	int listSize;
	public:
	List(){
		head = new Request();
		tail = new Request();
		head->next = tail;
		head->prev = head;
		tail->next = tail;
		tail->prev = head;
		listSize = 0;
	}
	Request* GetHead(){
		return head;
	}
	Request* GetTail(){
		return tail;
	}
	int GetListSize(){
		return listSize;
	}
	void DecreaseList(){
		listSize--;
	}
	void Insert(Request *req){
		if(head->next == head){
			head->next = req;
			req->prev = head;
			tail->prev = req;
			req->next = tail;
		}
		else{
			req->next = tail;
			req->prev = tail->prev;
			tail->prev->next = req;
			tail->prev = req;
		}
		listSize++;
	}
	void Delete(int sec){
		Request *pos = head->next;
		while(pos != tail){
			if((sec - pos->startTime) == pos->endTime){
				Request *tmp = pos;
				pos = pos->next;
				tmp->prev->next = tmp->next;
				tmp->next->prev = tmp->prev;
				delete tmp;
				DecreaseList();
			}
			else{
				pos = pos->next;
			}
		}
	}
	void PrintRequest(){
		Request *pos = head->next;
		while(pos != tail){
			printf("req num : %5.1d | Video -- %4.1d | Seg -- %5.1d | Ver -- %1.1d | Start time -- %5.1d | End time -- %5.1d |\n", pos->clientNum, pos->video, pos->seg, pos->ver, pos->startTime, pos->endTime);
			pos = pos->next;
		}
	}
};

